import React from "react";
import "./ForecastDaily.css";

export default function ForecastDaily({ data }) {
  function week() {
    let date = new Date(data.dt * 1000);
    let day = date.getDay();

    const days = ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"];
    return days[day];
  }
  return (
    <div className="ForecastDaily">
