      <div>
        <span className="forecast-max-temp">{Math.round(data.temp.max)}ºC</span>{" "}
        |{" "}
        <span className="forecast-min-temp">{Math.round(data.temp.min)}ºC</span>
      </div>
      <div className="forecast-description">{data.weather[0].description}</div>
    </div>
  );
}
